import "./topbar.css"

export default function Topbar() {
  return (
    <div className='top'>
      <div className="topLeft"><i class="fa-brands fa-facebook"></i></div>
      <div className="topCenter">c</div>
      <div className="topRight">r</div>
    </div>
  )
}
